import React, { Component } from 'react'

export default class button extends Component {
  constructor() {
    super()
    this.state = {
      time: 15 
    }
  }
  render() {
    return (
      <div>
      <div className="btn">`${this.state.time} mins`</div>
      </div>
    )
  }
}
